        <button>Î∂ÑÏÑùÌïòÎü¨ Í∞ÄÍ∏∞</button>
      </section>

      <footer className="footer">
        <div className="social-links">
          <a href="#">Instagram</a>
          <a href="#">Facebook</a>
          <a href="#">Twitter</a>
        </div>
      </footer>
    </div>
  );
}

export default Home;
